#include <iostream>
using namespace std;

float triangleArea(float a, float b, float c) {
   float s = (a + b + c) / 2;
   float area = sqrt(s*(s-a)*(s-b)*(s-c));
   return area;
}

int main() {
   float a, b, c;
   cout << Enter sides of triangle: ;
   cin >> a >> b >> c;
   float area = triangleArea(a, b, c);
   cout << The area of triangle is  << area << endl;
   return 0;
} 

